using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace AoC2018
{
    class Day5
    {
        string origInput = "";
        public void Day5Task1()
        {
            //string origInput = "dabAcCaCBAcCcaDA";
            HashSet<char> hash = new HashSet<char>(origInput);
            var unq = hash.OrderBy(i => i);
            List<string> pairs = new List<string>();
            int k = 0;
            for (int i = 0; i < unq.Count()/2; i++)
            {
                pairs.Add(unq.ElementAt(i).ToString() + unq.ElementAt(i + unq.Count() / 2).ToString());
                pairs.Add(unq.ElementAt(i + unq.Count() / 2).ToString() + unq.ElementAt(i).ToString());
            }
            while (k < 5000)
            {
                foreach (var pair in pairs)
                {
                    origInput = origInput.Replace(pair, "");
                }
                k++;
            }

            Console.WriteLine(origInput.Count());
            Console.ReadKey();
        }

        public void Day5Task2()
        {
            HashSet<char> hash = new HashSet<char>(origInput);
            var unq = hash.OrderBy(i => i);
            string input = "";
            List<int> result = new List<int>();
            
            List<string> pairs = new List<string>();
            for (int l = 0; l < unq.Count() / 2; l++)
            {
                    pairs.Add(unq.ElementAt(l).ToString() + unq.ElementAt(l + unq.Count() / 2).ToString());
                    pairs.Add(unq.ElementAt(l + unq.Count() / 2).ToString() + unq.ElementAt(l).ToString());
            }
            for (int i = 0; i < unq.Count() / 2; i++)
            {
                input = origInput.Replace(unq.ElementAt(i).ToString(), "");
                input = input.Replace(unq.ElementAt(i + unq.Count() / 2).ToString(), "");
                int k = 0;
                
                while (k < 5000)
                {
                    foreach (var pair in pairs)
                    {
                        input = input.Replace(pair, "");
                    }
                    k++;
                }
                result.Add(input.Count());
                
            }

            Console.WriteLine(result.OrderBy(i => i).First());
            Console.ReadKey();
        }

    }
}
